def GetIconBundle():
    global ImageData

    l = ImageData.keys()
    l.sort()

    bundle = wxIconBundle()

    for k in l:
        stream = cStringIO.StringIO(ImageData[k])
        img = wxImageFromStream(stream)
        bmp = wxBitmapFromImage(img)
        stream.close()

        ico = wxIcon("", k)
        ico.CopyFromBitmap(bmp)

        bundle.AddIcon(ico)

    return bundle
